function toggleProgressIndicator(show) {
	//TODO: Move this to its div
	var control = "#divProgress";
	if (show) {
		$(control).show();
	} else {
		if (searchCount == 0) {
			$(control).hide();
		}
	}
}

function search() {
	for (var i = 0; i < searchGroups.length; i++) {
		doSearch(searchGroups[i].ContainerName, searchGroups[i].Url, true, searchGroups[i].LanguageCode);
	}
}

function doSearch(containerName, url, showProgressIndicator, languageCode) {
	if (url != '') {
		toggleProgressIndicator(showProgressIndicator);
		if (showProgressIndicator) {
			searchCount++;
		}
		$.ajax({
			beforeSend: function (request) {
				request.setRequestHeader("Accept-Language", languageCode);
			},
			url: url,
		})
			.done(function (data) {
				$('#' + containerName).html($(data).find('#jqueryContent').html());
				if (showProgressIndicator) {
					searchCount--;
					toggleProgressIndicator(false);

					$(".jsMatchHeights").matchHeight();
				}
			});
	}
}

function doFullTypeSearch(containerKey) {
	for (var i = 0; i < searchGroups.length; i++) {
		if (searchGroups[i].Type.toLowerCase() == containerKey.toLowerCase()) {
			window.location.href = searchGroups[i].TypeOnlyUrl;
			break;
		}
	}
}

