function setCookieLocation() {
	var browserLocation = location.host;
	var domainLocations = ["com", "be", "cz", "fr", "de", "ie", "it", "pl", "ru", "ro", "es", "uk"];
	var lastChar = browserLocation.split('.').pop();

	if ($.inArray(lastChar, domainLocations) != -1) {
		$('#cookie').cookieLegal({ slideAnimation: true, slideDuration: 1000, button: '#cookieBtn' });
		$.fn.cookieLegal = function (options) {
			var settings = $.extend({
				'slideAnimation': false,
				'slideDuration': 500,
				'button': null,
				'cookie': 'KFCookiesAccepted'
			}, options);

			if (!hasCookie()) {
				
				this.each(function () {
					var item = this;
					if (settings.button !== null) {
						$(settings.button).click(function () {
							animate(item, false);
						});
					}
					animate(item, true);
				})

				writeCookie();
			}

			function writeCookie() {
				$.cookie(settings.cookie, 'val', { path: '/', expires: getExpiration() });
			};

			function hasCookie() {
				return $.cookie(settings.cookie) != null;
			};

			function animate(item, show) {
				if (settings.slideAnimation) {
					$(item).slideToggle(settings.slideDuration, function () { });
				}
				else {
					$(item).toggle();
				}
				
			};

			function getExpiration() {
				var date = new Date();
				date.setTime(date.getTime() + (730 * 24 * 60 * 60 * 1000));
				return date;
			};
		};
	}
};
