function setContent(location) {
    $('.box').fadeOut("slow");
    $('#treeLinks li ul').removeClass("mustShow");
    $('div#' + location).fadeIn("slow");
    $('.' + location + 'Sub').addClass("mustShow");
}

function setContent(location) {
    $('.box').fadeOut("slow");
    $('#treeLinks li ul').removeClass("mustShow");
    $('.contEPeople').fadeOut("slow");
    $('div#' + location).fadeIn("slow");
    $('.' + location + 'Sub').addClass("mustShow");
}

function setEPeople(location) {
    $('div#' + location).fadeIn("slow");
    $('div#' + location + ' .close').fadeIn("slow");
}

function closeEPeople() {
    $('.contEPeople').fadeOut("slow");
    $('.close').fadeOut("slow");
}

function setgm(location) {
    $('div#' + location).fadeIn("slow");
    $('div#' + location + ' .close').fadeIn("slow");
}

function closegm() {
    $('.gm').fadeOut("slow");
    $('.close').fadeOut("slow");
}

var ie8 = false;

function openLocation(location) {
    if (ie8 == false) {
        $('.box').fadeOut("slow");
        $('div#' + location).fadeIn("slow");
        $('div#' + location + 'Highlight').fadeIn("slow");
    } else {
        $('.box').hide();
        $('div#' + location).show();
        $('div#' + location + 'Highlight').show();
    }
}

function highlightLocation(location) {
    $('div#' + location + 'Highlight').show();
}

function hideLocation(location) {
    $('div#' + location + 'Highlight').hide();
}

function growWithUs(item) {
    $('.' + item + ' div').fadeIn();
}

function growWithUsOut(item) {
    $('.' + item + ' div').fadeOut();
}
