jQuery.fn.fadeSliderToggle = function (settings) {
    /* Damn you jQuery opacity:'toggle' that dosen't work!~!!!*/
    settings = jQuery.extend({
        speed: 500,
        easing: "swing"
    }, settings)

    caller = this
    if ($(caller).css("display") == "none") {
        $(caller).animate({
            opacity: 1,
            height: 'toggle'
        }, settings.speed, settings.easing);
    } else {
        $(caller).animate({
            opacity: 0,
            height: 'toggle'
        }, settings.speed, settings.easing);
    }
}; 